import * as React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card'
import TextField from '@mui/material/TextField';
import CardContent from '@mui/material/CardContent';
export default function PostForm() {
  return (
    <Card sx={{ m: 5, width: 300, height: 400 }}>
      <CardContent>
        <Box
          component='form'
          sx={{
            // '& .MuiTextField-root': { m: 1, width: '25ch' },
            width: 300,
            height: 500,
            m: 5,
          }}
          noValidate
          autoComplete='off'
        >
          <div>
            <TextField
              id='outlined-Creator-input'
              label='Creator'
              inputProps={{
                style: {
                  height: '50px',
                },
              }}
            />
            <TextField id='outlined-Title-input' label='Title' />
            <TextField id='outlined-Message-input' label='Message' />
            <TextField id='outlined-Tags-input' label='Tags' />
          </div>
          <div></div>
        </Box>
      </CardContent>
    </Card>
  );
}
